B.A1=new A.d2("What is the schedule for the day?","10:00 AM - Sealing Ceremony at the Orem Temple\n10:30 AM - Photos at the Orem Temple\n12:00 PM - Luncheon at Highland Gardens\n6:00 PM - Reception at Highland Gardens",null)
B.zX=new A.d2("What time should I arrive?","For guests attending the sealing ceremony, it will start promptly at 10:00 AM. We ask that you arrive at least 30 minutes early to the temple. \n\nFor guests that would like to be in photos at the temple, we ask that you arrive by 10:15 AM. We will have someone direct you to where you can wait for us to exit. We will be taking photos immediately following the sealing ceremony. \n\nFor guests attending the luncheon, it will start at 12:00 PM. We ask that you arrive on time for this portion of the event. \n\nFor guests attending the reception, it will start at 6:00 PM. We ask that you arrive on time for this portion of the event. We have a lot of fun planned and we don\u2019t want you to miss out on anything!",null)
B.A3=new A.d2("Will there be alcohol?","No. There will not be any alcohol provided and we ask that you do not bring any. Our venue does not allow alcohol on the premises. Additionally, we do not drink, so we will not accept any gifts of alcohol.",null)
B.zV=new A.d2("Can I smoke at the event?","No. Our venue does not allow smoking on the premises. We ask that you refrain from smoking during all events. If you need to smoke, please leave the premises to do so.",null)
B.A2=new A.d2("What should I wear?","All guests are encouraged to wear their Sunday best. The wedding colors are dark teal and gold, but you are not required to wear those colors. Please pick something that you would be comfortable having your picture taken in.",null)
B.zZ=new A.d2("Can I take pictures?","We have an amazing photographer who will be taking pictures of everything throughout the event. We encourage you to enjoy your time with us and let the photographer capture the moments. However, if you would like to take pictures, as long as you turn your flash off, you are welcome to take as many pictures as you would like. We would love to see them!",null)
B.A7=new A.d2("Can I bring a gift?","Your presence is the best gift we could ask for. We do not expect any gifts, but if you would like to give us something, we have a registry available under the registry tab of this website with our preferred gifts.",null)
B.zY=new A.d2("Can I send a gift to your home instead of bringing it to the wedding?","As of the time this was written, we do not have a permanent home. If you would like to give us a gift, we ask that you bring it to the wedding. If you are unable to attend the wedding, please contact us and we can make arrangements for you to send a gift.",null)
B.A_=new A.d2("Can I bring a plus one?","Yes, you may bring a plus one. Please make sure to include them in your RSVP so we can make sure to plan for everyone.",null)
B.A5=new A.d2("Can I bring my kids?","We love kids and would love to have them at our wedding. However, we will not have any activities or childcare available, so if you choose to bring them it is your responsibility to keep them entertained and quiet during the event. Please make sure to include them in your RSVP so we can plan for them.",null)
B.A6=new A.d2("Can I attend the Temple Sealing?","A temple sealing is a sacred and deeply meaningful ceremony performed in a temple of The Church of Jesus Christ of Latter-day Saints. In this ceremony, we are united as husband and wife, not just for this life but for eternity. It's an opportunity for us to make sacred promises to each other and to God.\n\nTemple sealings take place in dedicated spaces that are set apart as holy. To maintain the sacred nature of these ordinances, attendance is limited to members of our faith who hold an active temple recommend, which is a personal commitment to live in accordance with the teachings of the gospel.\n\nWe deeply value and love everyone in our lives, and while this part of the day is intimate and spiritual, we are excited to celebrate with all of you during the rest of the events planned for the day. If you do not possess a temple recommend, we would love to have you join us for photos at the temple, the luncheon and reception. Your presence in our lives is incredibly important to us, and we feel blessed to have your support.",null)
B.A0=new A.d2("Will there be food?","Yes! We will have a meal at the luncheon and refreshments at the reception. If you have any dietary restrictions, please make sure to include them in your RSVP so we can plan accordingly.",null)
B.zW=new A.d2("Will you be providing hotels and transport?","No, we will not be providing hotels or transport for any of our guests. If you are coming from out of town, please book your own accommodations and arrange for any transport you will need throughout the day.",null)
B.zU=new A.d2("Who should I contact on the day of the wedding if I have trouble finding the venue or have questions?","On the day of the wedding, if you have any trouble finding the venue or have any questions, please contact Amanda DeClerk, at 515-238-5551.",null)
B.A4=new A.d2("What is the best way to get in touch with you guys if I have questions prior to the wedding?","The best way to get in touch with us is to text us at 515-313-8558 and 657-357-1642. We will do our best to respond to you in a timely manner.",null)
